import { connect } from 'react-redux';
import { compose } from 'redux';
import { createStructuredSelector } from 'reselect';
import testSelectors from 'state/ducks/test/selectors';
// ACTIONS
import testActions from 'state/ducks/test/actions';
import ReadingTest from '.';

const mapStateToProps = createStructuredSelector({
	activeTest: testSelectors.makeSelectActiveTest(),
	readingAnswers: testSelectors.makeSelectReadingAnswers(),
});

function mapDispatchToProps(dispatch) {
	const addTest = payload => dispatch(testActions.addTest(payload));
	const updateReadingAnswers = payload => dispatch(testActions.updateReadingAnswers(payload));
	const removeAnswersSheet = () => dispatch(testActions.removeAnswerSheet());
	return {
		dispatch,
		addTest,
		updateReadingAnswers,
		removeAnswersSheet,
	};
}

const withConnect = connect(mapStateToProps, mapDispatchToProps);

export default compose(withConnect)(ReadingTest);
